  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320" className={styles.wave}>
      <path className={styles.path}
        fill={props.waveColor}
        fill-opacity="1"
        d="M0,160L80,181.3C160,203,320,245,480,229.3C640,213,800,139,960,112C1120,85,1280,107,1360,117.3L1440,128L1440,320L1360,320C1280,320,1120,320,960,320C800,320,640,320,480,320C320,320,160,320,80,320L0,320Z"
      ></path>
    </svg>
  );
};

export default Hero;
